        }
    }

    render() {
        return (
            <Wrapper>
                <Container>
                    <Content>Amit is a batty boy</Content>
                    <GoogleButton />
                    <FacebookButton />
                </Container>
            </Wrapper>
        )
    }
}

Home.propTypes = {
    
}

export default Home
